class baseDemo(object):
    """通用基础类，调用返回值，使用等号时判断"""
    def _g(self):
        return None

    def __call__(self, *args, **kwargs):
        return self._g

    def __str__(self):
        r = self._g
        if isinstance(r,(str)):
            return r
        else:
            return str(r)
    __rept__ = __str__

class Int(baseDemo):
    def __init__(self,min_n=2, max_n=10):
        self.min_n, self.max_n = int(min_n), int(max_n)

    def __eq__(self, other):
        return isinstance(other,int) and self.min_n<other<self.max_n

    @property
    def _g(self):
        return randint(self.min_n, self.max_n)

class Float(baseDemo):
    def __init__(self,mins=2, maxs=10, bt=2):
        if str(bt).find('-') !=-1:
            a,b = str(bt).split('-')
            if a>b:
                a,b=b,a
            bt=randint(int(a),int(b))
        self.min_n, self.max_n, self.bt = int(mins), int(maxs), int(bt)

    @property
    def _g(self, ):
        number = random.uniform(self.min_n, self.max_n)
        return round(number, self.bt)

    def __eq__(self, other):
        try:
            other = float(other)
            if not  float(self.min_n) < other < float(self.max_n):
                return False
            text = str(other).split('.')[1]
            return len(text)==self.bt
        except Exception as e:
            print (e)
            return False


