class Id(baseDemo):
    """
    随机生成一个身份证号，可校验
    """
    def __init__(self,code=None,show_addr=False):
        self.code=code
        self.show_addr=show_addr
        self.weight = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2]  # 权重项
        self.checkcode = {'0': '1', '1': '0', '2': 'X', '3': '9', '4': '8', '5': '7', '6': '6', '7': '5', '8': '5', '9': '3',
                     '10': '2'}
    @property
    def _g(self):
        # 用于随机生成身份证编码
        distcode = Address(self.code,True)()
        id = distcode[1]  # 6位地址码
        id += str(randint(1930, 2017))  # 4位出生年份
        da = date.today() + timedelta(days=randint(1, 366))  # 月份和日期项
        id += da.strftime('%m%d')  # 4位出生日期
        id += str(randint(100, 999))  # 3位顺序号
        # 校验码换算映射
        count=0
        for i,value in enumerate(id):
            count = count + int(value) * self.weight[i]
        id += self.checkcode[str(count % 11)]  # 算出一位校验码
        if self.show_addr:
            return id,distcode[0]
        return id

    def __eq__(self, code):
        # 身份证号校验
        if not code[:6] in dist_codes:
            print ("%s 不属于正确的政区编码" %code[:6] )
            return False
        count = 0
        for i,value in enumerate(code[:-1]):
            count = count + int(value) * self.weight[i]
        result= code[-1]==self.checkcode[str(count % 11)] #比对最后一位校验码
        if not result:
            print("根据校验码规则身份证号应以%s结束" % self.checkcode[str(count % 11)] )
        return result


class Bankcode(baseDemo):
    """
    随机生成一个银联卡好，可校验
    """
    @ property
    def _g(self):
        # 生成银联卡号
        bankc = str(622126 + randint(0, 800))
        bankc += "".join(choice("0123456789") for i in range(choice((9, 12))))
        luhmSum = 0
        for i, value in enumerate(reversed(list(map(int, bankc)))):
            k = value
            if i % 2 == 0:
                k *= 2
                k = k // 10 + k % 10
            luhmSum += k
        if luhmSum % 10 == 0:
            bankc += "0"
        else:
            bankc += str(10 - luhmSum % 10)
        return bankc

    def __eq__(self, other):
        # 银联卡luhmSum算法校验
        digits = [int(x) for x in reversed(str(other))]
        check_sum = sum(digits[::2]) + sum((dig // 10 + dig % 10) for dig in [2 * el for el in digits[1::2]])
        return check_sum % 10 == 0


class Geo_position(baseDemo):
    """
        随机生成有一组经纬度坐标
    """
    def __init__(self,bbox=(115.0, 39.0, 117.0, 41.0)):
        self.bbox = bbox
        self.x = 10
        self.step=0.0000707
        self.direction = randint(0, 360)
        lat_c = map(lambda a:a*self.x,self.bbox[1::2])
        lon_c = map(lambda a:a*self.x,self.bbox[0::2])
        self.lat = Float(*lat_c)()/self.x
        self.lon = Float(*lon_c)()/self.x

    def __call__(self, *args, **kwargs):
        return [self.lon, self.lat]

    def __iter__(self):
        yield self.__next__()

    def __next__(self):
        direction = (self.direction + Float(-90, 90)()) % 360
        direction2=direction/180*math.pi
        self.lat+=self.step*math.cos(direction2)
        self.lon+=self.step*math.sin(direction2)
        return [self.lon, self.lat]

