class Randdate(baseDemo):
    """
    随机生成一个有效的日期时间范围
    """
    @property
    def _g(self):
        # 随机生成一组有效时间范围
        year = randint(1990, 2017)
        days = randint(1, 360)
        da = date(1990, 1, 1) + timedelta(days=days)
        da.replace(year)
        date1 = da.strftime('%Y-%m-%d')
        days2 = self.days_tmp(days)
        da2 = date(1990, 1, 1) + timedelta(days=days2)
        da2.replace(year)
        date2 = da2.strftime('%Y-%m-%d')
        return [date1, date2]

    def days_tmp(self,days):
        days2 = days + randint(1, 366)
        if days2 > 365 and (days2 - 365) < days:
            return self.days_tmp(days)
        elif days2 > 365 and (days2 - 365) > days:
            return days2 - 365
        else:
            return days2


def take_data(reg, data):
    """
    从已有数据中提取数据
    :param reg:  数据路径
    :param data:  数据源，dict
    :return: 提取的数据
    """
    text = reg[1:].split(u'.')
    for i in text:
        if isinstance(data, list) and i.isdigit():
            data = data[int(i)]
        elif isinstance(data,dict):
            data = data[i]
        else:
            return None
    return data

def data_associate(data,fromdata={}):
    """
    用于数据生成与关联
    :param data: 元数据数据
    :param fromdata: 关联数据源
    :return: 生成后的数据
    """
    if isinstance(data,list):
        result = []
        for i in data:
            result.append(data_associate(i,fromdata))

    elif isinstance(data,dict):
        result = {}
        for key, value in data.items():
            if isinstance(value,(dict,list)):
                result[key]=data_associate(value,fromdata)

            elif isinstance(value,(str,str)):
                if value:
                    if value.startswith(u'm$'):
                        # 从已有数据中提取
                        result[key]=take_data(value[1:],fromdata)
                    elif value.startswith(u'm@'):
                        # 根据mock规则生成数据
                        reg = re.compile(u"[\(\),@]")
                        args_text = re.split(reg, value)
                        while u"" in args_text:
                            args_text.remove(u"")
                        text=u'%s%s' %(args_text[1][0].upper(),args_text[1][1:])
                        args = args_text[2:]
                        try:
                            method =eval(text)
                            # method = getattr(__builtins__,text,False)
                            result[key]=method(*args)()
                        except:
                            result[key] = value
                    else:
                        result[key]=value
                else:
                    result[key] = value
            else:
                result[key] = value
    else:
        result=None
    return result


